import { Component } from '@angular/core';


@Component({
  selector: 'app-blog',
  templateUrl: './blog.component.html',
  styleUrls: ['./blog.component.css']
})
export class BlogComponent {

  displayedColumns: string[] = ['position', 'name', 'weight', 'symbol'];
}
